import React from 'react';
import '../css/Nav.module.css';

const Nav = () => {
    return (
        <nav className={classes.nav}>
            <div>
                <a href="">Профиль</a>
            </div>
            <div>
                <a href="">Сообщения</a>
            </div>
            <div>
                <a href="">Новости</a>
            </div>
            <div>
                <a href="">Музыка</a>
            </div>
            <div>
                <a href="">Настройки</a>
            </div>
      </nav>
    );
}

export default Nav;
